CREATE TABLE "TRADE"
   (	"ID" NUMBER(38,0),
	"SIDE" VARCHAR2(1 BYTE),
	"QUANTITY" NUMBER(38,0),
	"PRICE" NUMBER,
	"TRADE_DATE" TIMESTAMP (6),
	"STATUS" VARCHAR2(20 BYTE),
	"COMMODITY_CD" VARCHAR2(20 BYTE),
	"LOCATION_CD" VARCHAR2(20 BYTE),
	"COUNTERPARTY_CD" VARCHAR2(20 BYTE)
   ) ;

   REM INSERTING into TRADE
   SET DEFINE OFF;

 CREATE UNIQUE INDEX "TRADE_PK" ON "TRADE" ("ID") ;

 ALTER TABLE "TRADE" ADD CONSTRAINT "TRADE_PK" PRIMARY KEY ("ID")
   USING INDEX PCTFREE 10 INITRANS 2 MAXTRANS 255 COMPUTE STATISTICS 
   STORAGE(INITIAL 65536 NEXT 1048576 MINEXTENTS 1 MAXEXTENTS 2147483645
   PCTINCREASE 0 FREELISTS 1 FREELIST GROUPS 1 BUFFER_POOL DEFAULT FLASH_CACHE DEFAULT CELL_FLASH_CACHE DEFAULT)
   TABLESPACE "USERS"  ENABLE;
   ALTER TABLE "TRADE" MODIFY ("SIDE" NOT NULL ENABLE);
   ALTER TABLE "TRADE" MODIFY ("ID" NOT NULL ENABLE);


commit;